import React, { useEffect, useState } from 'react';
import axios from 'axios';

function PopisLovaca() {
    const [lovci, setLovci] = useState([]);

    useEffect(() => {
        axios.get('/popis-lovaca')
            .then(response => {
                if (response.data.error) {
                    console.error('Failed to fetch hunters:', response.data.message);
                    alert('Error: ' + response.data.message);
                } else {
                    setLovci(response.data.data);
                }
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }, []);

    return (
        <div style={{ padding: '20px' }}>
            <h1>Popis Lovaca</h1>
            <table style={{ width: '100%', borderCollapse: 'collapse' }}>
                <thead>
                    <tr>
                        <th>Ime</th>
                        <th>Prezime</th>
                        <th>Adresa</th>
                        <th>Datum rođenja</th>
                        <th>Kontakt</th>
                        <th>Korisničko ime</th>
                        <th>Uloga</th>
                    </tr>
                </thead>
                <tbody>
                    {lovci.map((lovac, index) => (
                        <tr key={index}>
                            <td>{lovac.ime}</td>
                            <td>{lovac.prezime}</td>
                            <td>{lovac.adresa}</td>
                            <td>{lovac.datum_rodjenja}</td>
                            <td>{lovac.kontakt}</td>
                            <td>{lovac.korisnicko_ime}</td>
                            <td>{lovac.uloga}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default PopisLovaca;
